var subtitleTimer = null;
function SetSubtitle(_chs, _eng, _fadeTime, _delay, _callback){
    subtitle.find(".chs").html(_chs);
    subtitle.find(".eng").html(_eng);
    subtitle.hide();

    clearTimeout(subtitleTimer);
    subtitle.fadeIn(_fadeTime, function(){
        subtitle.delay(_delay).fadeOut(_fadeTime, function(){
            _callback && _callback();
        });

        subtitleTimer = setTimeout(function () {
            subtitle.fadeOut(_fadeTime, function(){
                _callback && _callback();
            }, _delay);
        });
    });
}


//...
function playFrames(_selector, _name, _frame) {
    //console.log(_frame);

    _selector
        .stop(true, true)
        .attr("data-frame", fixedZero(_frame))
        .attr("data-name", _name)
        .alterClass((_name + '*'), (_name + fixedZero(_frame)));
}

